**Safety & Control of Information and Devices Competence** encompasses protecting devices and personal information: using security measures, managing privacy settings, identifying phishing, and controlling what information is shared online.



::: {.cell}

:::



## {{< iconify ph lightning-fill >}} Safety Skills


**Skills** measures participants’ *self-assessed ability* to perform a wide range of digital tasks. These items capture how confident people feel doing things like searching for information.


::: {.cell}
::: {.cell-output-display}

